import React, { useEffect, useState } from "react";

const DashBoardStocktaking = ({ stocktake }) => {
  return (
    <div>
      <h6>
        Stocktaking
        {stocktake ? (
          <p>Stocktake in Progress</p>
        ) : (
          <p>No Stocktake in Progress</p>
        )}
      </h6>
    </div>
  );
};

export default DashBoardStocktaking;
